webpackJsonp([0x5b5cd6eb368f],{878:function(o,e){o.exports={data:{post:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/posts/2018-03-06--macbook-keyboard-failing/index.md absPath of file >>> MarkdownRemark",html:'<h1>現象</h1>\n<p>いきなりキーボード「f」ボタンが中に少し入ったまま、でてこない。</p>\n<p>入力できなくはないが、たまに入力されないこともあり、不便。</p>\n<br>\n<h1>やったこと</h1>\n<h3>1. Apple Storeにお問い合わせ</h3>\n<p>Apple Storeに問い合わせたら、まず予約して、中を見てみないと分からない。</p>\n<p>修理期間も一週間ぐらいはかかるという答え（短くても三日、四日はかかる）</p>\n<h3>2. キーボードを掃除する（これで解決！！）</h3>\n<p><a href="https://support.apple.com/ja-jp/HT205662">MacBook や MacBook Pro のキーボードのお手入れ方法</a></p>\n<p>調べたら↑のURLを見つけました。</p>\n<p>まさかこれで解決するかなって最初は疑ったんですが・・</p>\n<p>本当にこれで解決。\n（ちゃんと手順が書いてあるし、画像もあったので分かりやすい）</p>\n<br>\n<h1>結論</h1>\n<p>MacBook (2015 以降) や MacBook Pro (2016 以降) のキーが反応しなくなった場合や、押したときにほかのキーと感触が違うキーがある場合は、まずは、↑の手順にそって、キーボードをきれいに掃除しましょうー！</p>',fields:{slug:"/macbook-keyboard-failing/",prefix:"2018-03-06"},frontmatter:{title:"新型 Macbook pro キーボードの一部が反応しない時の対応",subTitle:"",cover:{childImageSharp:{resize:{src:"/static/apple-logo-0ad0aeb270652f1525e72523f7a88825-ada8c.jpg"}}}}},author:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>jslee</strong> <br>\n福岡在住外国籍WEBエンジニア。<br>\nPHP(CakePHP) / Angular / Ionic / Vue.js / <br>\nGraphQL / Docker / Web Design / UI, UX ･･･</p>"},footnote:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li><a href="https://lighthouse-dev.github.io/">lighthouse.log</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"152072888976323"}}}},pathContext:{slug:"/macbook-keyboard-failing/"}}}});
